import './Recognization.css';

function Recognization() {
  return (
    <div className='recognization'>
        <div className='process'>
            <h2 className='title'></h2>
            <img src='' className=''></img>
            <p className='comment'></p>
        </div>
    </div>
  )
}

export default Recognization
